import React, { useState, ChangeEvent, FormEvent } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import ContactImage from '../../'
const ContactForm = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        cpfCnpj: '',
        product: ''
    });

    const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e: FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        // Aqui você pode enviar os dados do formulário para o servidor
        console.log(formData);
        // Limpar os campos do formulário após o envio
        setFormData({
            name: '',
            email: '',
            cpfCnpj: '',
            product: ''
        });
    };

    return (
        <Container maxWidth="md">
            <Box sx={{ mt: 8, mb: 8 }}>
                <Typography variant="h4" fontSize={30} fontWeight={600} fontFamily={"Montserrat"} align="center" sx={{ mb: 4 }}>Faça uma cotação</Typography>
                <Box component="form" onSubmit={handleSubmit} sx={{ display: 'flex', flexDirection: 'column' }}>
                    <Stack spacing={2}>

                        <TextField
                            label="Nome"
                            id="name"
                            name="name"
                            value={formData.name}
                            onChange={handleChange}
                            required
                        />
                        <TextField
                            label="Email"
                            id="email"
                            name="email"
                            type="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                        />
                        <TextField
                            label="CPF/CNPJ"
                            id="cpfCnpj"
                            name="cpfCnpj"
                            value={formData.cpfCnpj}
                            onChange={handleChange}
                            required
                        />
                        <TextField
                            label="Produto"
                            id="product"
                            name="product"
                            value={formData.product}
                            onChange={handleChange}
                            required
                        />
                        <Button variant="contained" type="submit">Enviar</Button>
                    </Stack>
                </Box>
                <img src="" alt="" />
            </Box>
        </Container>
    );
};

export default ContactForm;
